const square = (svg) => {
  const [x, y, w, h] = svg
    .getAttribute("viewBox")
    .split(/ +/)
    .map((s) => Number(s));
  const [width, height] = [w - x, h - y];
  if (width > height) {
    svg.setAttribute("viewBox", `${x} ${y + (h - w) * 0.5} ${w} ${w}`);
  } else if (width < height) {
    svg.setAttribute("viewBox", `${x + (w - h) * 0.5} ${y} ${h} ${h}`);
  }
  return svg;
};

const aryLogos = (year = 2022) => {
  const ary = data.slice(0, 30);
  const y = Number(year);
  if (y < 2022) {
    // Indians -> Guardians
    const idxG = data.findIndex((o) => o.team === "GUARDIANS");
    ary[idxG] = data.find((o) => o.team === "INDIANS");
  }
  if (y < 2020) {
    const idxB = data.findIndex((o) => o.team === "BREWERS");
    ary[idxB] = data.find((o) => o.team === "BREWERS" && o.years?.includes(y));
  }
  return ary;
};
const get_teams = (year = 2022) => aryLogos(year).map((o) => o.team);

const get_logos = (year = 2022) =>
  aryLogos(year).reduce((acc, cur) => {
    const div = document.createElement("div");
    div.innerHTML = cur.svg;
    acc[cur.team] = square(div.firstElementChild);
    return acc;
  }, {});

const logos = get_logos(2022);

export { get_teams, get_logos, logos };
